<template>
  <div>
    <img :src="imageSrc" :alt="altText">
  </div>
</template>

<script>
export default {
  data() {
    return {
      // Replace 'yourBase64ByteString' with the actual base64 string representing your image
      base64String: '',
      mimeType: 'image/jpg', // Replace with the actual MIME type of your image
      altText: 'Image Alt Text', // Replace with the desired alt text
    };
  },
  computed: {
    imageSrc() {
      return `data:${this.mimeType};base64,${this.base64String}`;
    },
  },
};
</script>

